import { Link } from "react-router-dom";

const Nav = () => {
  return (
    
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
  <div className="container"> {/* Wrap the content within a container */}
    <div className="navbar-nav me-auto mb-2 mb-lg-0"> {/* Remove extra space class */}
      <ul className="navbar-nav me-auto"> {/* Add the 'me-auto' class to align items to the right */}
        <div className="list-inline"> {/* Change 'list' to 'list-inline' */}
          <li className="nav-item">
            <Link className="nav-link" to="/">Home</Link>
          </li>
          <li className="nav-item">
            <Link className="nav-link" to="/GroupedTeamMembers">Teams</Link>
          </li>
        </div>
      </ul>
    </div>
  </div>
</nav>

    
  );
}

export default Nav;
